import styles from "./Cards.module.css"
import Card from "../Card/Card"

const Cards =({pokemones}) =>{
    function convertirTipos(tipos) {
        return tipos.map((tipo) => tipo.name);
      }
    return(
        
        <div className={styles.card}>
            
            {pokemones.map(({attack, defense, hp, id,img,name, speed,types}) => {
                const typesFiltrados = convertirTipos(types);
                    return < Card 
                       id={id}
                       name={name}
                       attack={attack}
                       defense={defense}
                       img={img}
                       hp={hp}
                       speed={speed}
                       types = {typesFiltrados}
                       
                    //    onClose={onClose}asdsa
                    />
                 } )
            }

        </div>
    )
}

export default Cards;
